const list = [
	{
		id: 1,
		q: "산책을 오랫동안 안하면",
		a1: "온몸으로 어필한다",
		a2: "기다려본다",
	},
	{
		id: 2,
		q: "배고프면",
		a1: "무력으로 음식을 쟁취한다",
		a2: "애교를 부린당",
	},
];
export default list;
